@kanyewest that has just released his new album ’Donda’ in this shot was wearing one the @rolex’s most signature models, the Submariner. The version worn by the American artist is no longer in production and it features a 40mm 18k yellow gold case, the bezel is made in blue ceramic with matching blue dial. Since Kanye is one of the most avant-garde artists in the fashion industry do you think this model could get more attention in the near future? #Rolex

Retail price: $ 34,250.00

Photo: @backgrid_usa | @rolex
